window.bookSummaryJSON = "<p>The New York Times best seller and the Audie Award winner.</p> <p>THIRTY DAYS.</p> <p>That’s all Adam Steinbeck demands of his wife.</p> <p>Thirty days in a remote cottage, doing everything he demands, then he’ll sign her divorce papers, give her his half of their company, and walk away.</p> <p>He has 30 days to rediscover the man he once was. The Dominant Master he hid when he fell in love with the woman who would leave him five years later.</p> <p>Diana wants the company they built badly enough to go to the cottage with him.</p> <p>She’ll give him her body, but her heart will never yield.</p> <p>She thinks this is his pathetic attempt to repair their marriage.</p> <p>She’s wrong.</p>"; 
